package com.MITProjectService.admin.domain.system;import jakarta.persistence.*;import lombok.AllArgsConstructor;import lombok.Data;import lombok.NoArgsConstructor;import java.io.Serializable;@Data@AllArgsConstructor@NoArgsConstructor@Entity@Table(name = "authorities")public class Authorities implements Serializable {    @Id    @Column(name = "id")    @GeneratedValue(strategy = GenerationType.IDENTITY)    private Long id;    @Column(name = "userName",unique = true, nullable = false)    private String userName;    @Column(name = "authorities", unique = true, nullable = false)    private String authorities;}